/**
 *
 * @param url - путь запроса
 * @param form_data - массив данных
 * @param settings_personal
 * @param name_function
 * @param name_function_error
 * @returns {*}
 */
function postAjax(url, form_data, settings_personal, name_function, name_function_error) {
  //Add field page
  if(!form_data) {
    form_data = new FormData();
  }
  form_data.append('object_type', $('[data-content="object_type"]').val());
  form_data.append('id_object', $('[data-content="id_object"]').val());
  form_data.append('object_path_image', $('[data-content="object_path_image"]').val());

  $.ajaxSetup({
    headers: {
      'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
    }
  });
  let settings_default = {
    type: "post",
    url: url,
    cache: false,
    async: false,
    data: form_data,
    contentType: false,
    processData: false,
    success: function (data) {
      if(name_function) {
        name_function(data);
      } else {
        data_return = data;
      }
    },
    error: function (data) {
      if(name_function_error) {
        name_function_error(data);
      } else {
        Message.showMessageErrorFlash('Запрос не выполнен, статус: ' + data.statusText);
        data_return = data;
      }
    },
  };
  let settings = Object.assign(settings_default, settings_personal);
  let data_return = null;

  $.ajax(settings);

  return data_return;
}
/**
 * Добавляет ошибку с текстом
 * @param name
 * @param error_for_field
 */
function setError(object, error_for_field) {
    object.after('<div class="invalid-feedback">' + error_for_field + '</div>');
    object.addClass('is-invalid');
}


/**
 * Удаляет ошибки из полей модального окна
 */
function clearErrors(object_clear_errors) {
    if (object_clear_errors) {
        let parent = object_clear_errors.parent();
        parent.find('.invalid-feedback').remove();
        parent.find('input').removeClass('is-invalid');
    } else {
        $('#modal-form .invalid-feedback').remove();
        $('#modal-form input').removeClass('is-invalid');
    }
}
$(document).ready(function () {
  //Add/update image
  $('body').on('change', '[data-type=image] [data-action="add_file"]', function () {
    let file = this.files;
    addImage(file[0], $(this).closest("[data-type=image]"));
  });


  //Delete image
  $('body').on('click', '[data-type=image] [data-action="delete"]', function () {
    deleteImage($(this).closest("[data-type=image]"));
  });
});

function addImage(file, this_dom) {
  let form_data = new FormData();
  form_data.append('image', file);
  form_data.append('path_image_save', this_dom.data('path_image_save'));
  let src = postAjax('/general/save_image', form_data); //SaveImage
  this_dom.find("img").attr('src', src);
  this_dom.attr('data-path_image_store', src);
  this_dom.find('[data-action="delete"]').removeClass('d-none');
  this_dom.attr('data-change', true);
}

function deleteImage(this_dom) {
  let form_data = new FormData();
  form_data.append('path_image_save', this_dom.data('path_image_save'));
  let src = postAjax('/general/delete_image', form_data); //SaveImage
  this_dom.removeAttr('data-path_image_store');
  this_dom.find("img").attr('src', src);
  this_dom.find('[data-action="delete"]').addClass('d-none');
  this_dom.attr('data-change', true);
}
$('body').on('keydown', 'input[data-validation="numeric"]', function (e) {
  clearErrors($(this));
  if (e.key.length === 1 && e.key.match(/[^0-9'".17]/)) {
    if(!e.ctrlKey) {
      setError($(this), 'Можно вводить только числа');
      return false;
    }
  }
});
$('body').on('focusout', 'input', function (e) {
  clearErrors($(this));
});





/**
 * Deactivate standard submit form, we do it ourselves
 */
$(document).on('submit', "form[date-type='form_standard']", plugSubmit);
function plugSubmit(e) {
  e.preventDefault();
  return false;
}

/**
 * If default form automatic add attribute, but special form easily lead here
 */
$("form button[data-redirect]").closest("form").attr('date-type', 'form_standard');


/**
 * Added info of redirect
 */
$("form button[data-redirect]").click(function() {
  let form_parent = getFormSubmit(this);
  addRedirect(form_parent, this); //Add redirect
  addImageList(form_parent); //Add image
  addDateList(form_parent); //Add date list input
  addRequiredField(form_parent); //Add object_type, object_id, object_path_image

  $(document).off('submit', "form[date-type='form_standard']", plugSubmit);
  $(this).closest("form[date-type='form_standard']").submit();
});

function getFormSubmit(context) {
  return $(context).closest("form");
}


function addRedirect(form_parent, context) {
  let redirect = $(context).data('redirect');
  form_parent.prepend('<input type="hidden" name="redirect" value="' + redirect  + '" /> ');
}


function addImageList(form_parent) {
  let elements_image_list = '';
  $('[data-type="image"]').each(function (index, value){
    let path_image = $(this).attr('data-path_image_store');
    if(path_image) { //Isset save file
      form_parent.prepend('<input type="hidden" name="' + $(this).attr('data-name') + '" value="' +  $(this).attr('data-path_image_store') + '" />');
    }
    if($(this).attr('data-change') === 'true') {
      elements_image_list = elements_image_list + $(this).attr('data-name') + ',';
    }
  });

  if(elements_image_list) {
    elements_image_list = elements_image_list.substring(0, elements_image_list.length - 1);
    form_parent.prepend('<input type="hidden" name="elements_image_list" value="' + elements_image_list  + '" /> ');
  }
}


function addDateList(form_parent) {
  let elements_date_list = '';
  $('[data-type="date"]').each(function (index, value){
    elements_date_list = elements_date_list + $(this).attr('name') + ',';
  });
  if(elements_date_list) {
    elements_date_list = elements_date_list.substring(0, elements_date_list.length - 1);
    form_parent.prepend('<input type="hidden" name="elements_date_list" value="' + elements_date_list  + '" /> ');
  }
}


function addRequiredField(form_parent) {
  form_parent.prepend('<input type="hidden" name="object_type" value="' + $('[data-content="object_type"]').val()  + '" /> ');
  form_parent.prepend('<input type="hidden" name="id_object" value="' + $('[data-content="id_object"]').val()  + '" /> ');
  form_parent.prepend('<input type="hidden" name="object_path_image" value="' + $('[data-content="object_path_image"]').val()  + '" /> ');
}
