function settingsDateTimePicker() {
  let class_color = 'color-blue';
  $.fn.datetimepicker.Constructor.Default = $.extend({}, $.fn.datetimepicker.Constructor.Default, {
    icons: {
      time: class_color + ' fa fa-clock',
      date: class_color + ' fa fa-calendar',
      up: class_color + ' fa fa-arrow-up',
      down: class_color + ' fa fa-arrow-down',
      previous: class_color + ' fa fa-chevron-left',
      next: class_color + ' fa fa-chevron-right',
      today: class_color + ' fa fa-calendar',
      clear: class_color + ' fa fa-trash',
      close: class_color + ' fa fa-times'
    }, //showToday: true
  });
}

function initDateTimePickerForElement() {
  $('[data-type="date"]').each(function (indx, element) {
    let date = $(element).attr('data-value');
    let date_moment = moment(date, "DD.MM.YYYY").utc();
    let format = $(element).attr('data-format_date');
    $(element).datetimepicker();
    $(element).datetimepicker('format', format);
    $(element).datetimepicker('locale', 'ru');
    $(element).datetimepicker('defaultDate', date);
    $(element).datetimepicker('focusOnShow', true);

  });
}
'use strict';

//Объект доступный отовсюду
class Message {

//Флеш сообщения
  static showMessageErrorBtn($text) {
    this.showMessage($text, 'error', 'btn')
  }

  static showMessageInfoBtn($text) {
    this.showMessage($text, 'info', 'btn')
  }

  static showMessageSuccessBtn($text) {
    this.showMessage($text, 'success', 'btn')
  }


  static showMessageErrorFlash($text) {
    this.showMessage($text, 'error', 'flash')
  }

  static showMessageInfoFlash($text) {
    this.showMessage($text, 'info', 'flash')
  }

  static showMessageSuccessFlash($text) {
    this.showMessage($text, 'success', 'flash')
  }

  static showMessage($text, $status, $type) {
    let $class = null;
    if($status === 'error') {
      $class = 'danger';
    }
    if($status === 'info') {
      $class = 'info';
    }
    if($status === 'success') {
      $class = 'success';
    }
    if($type === 'btn') {
      this.showMessageBtn($text, $class);
    }
    if($type === 'flash') {
      this.showMessageFlash($text, $class)
    }
  }

  static showMessageBtn($text, $class) {
    $('[data-hook="top_message"]').prepend("" +
      "<div class=\"alert alert-" + $class + " alert-dismissible fade show\" role=\"alert\">" + $text +
      "<button type=\"button\" class=\"close\" data-dismiss=\"alert\" aria-label=\"Close\">\n" +
      "    <span aria-hidden=\"true\">&times;</span>\n" +
      "  </button>" +
      "</div>");
  }

  static showMessageFlash($text, $class) {
    $('[data-hook="top_message"]').prepend("<div class=\"alert alert-" + $class + " alert-flash \" role=\"alert\" data-dismiss=\"alert\">" + $text + "</div>");
    setTimeout(function () {
      $('.alert-flash').stop().animate({
        height: "0px", // высоту к нулю
      }, 100);
      $('.alert-flash').stop().animate({
        opacity: 0
      }, 1000);
    }, 1500);
    setTimeout(function () {
      $('.alert-flash').alert('close');
    }, 3000);
  }
}



